Tal como lo indica, el agua micelar es una mezcla de agua y micelas. Estas micelas tienen un extremo hidrófilo que es atraído por el agua, y un extremo lipófilo que es atraído por aceites y grasa. Por esta razón es que nos ayudan a eliminar suciedad, maquillaje y cualquier impureza que tengamos en la piel.

La diferencia con un jabón tradicional, 🙉es que los surfactantes utilizados en este tipo de fórmulas son mucho más suaves y gentiles para que estén en contacto con la piel por más tiempo y sin irritar.

Cuando dice (desmaquilla, hidrata y tonifica), es sencillamente que no es agresivo para tu piel, 🥺pero no le quita el hecho que contienen surfactantes, que igualmente quedan en contacto con nuestra piel.

Asi que despues de retirar con agua micelar, debes lavar tu carita con gel, crema, locion, espuma limpiadora que tengas y asi dejar la piel totalmente limpia.

